import React from 'react';
import './transaccion.css';

function Transaccion(props){
	return (
		<div className="transaccion">
			<div className="titulotransaccion">
				{props.codigo}
			</div>
			<div className="filatransaccion">
				<div className="textotransacciong">
					Grupo:
				</div>
				<div className="valortransacciong">
					{props.grupo}
				</div>
			</div>
			<div className="filatransaccion">
				<div className="textotransacciond">
					Descripci&oacute;n:
				</div>
				<div className="valortransacciond">
					{props.descripcion}
				</div>
			</div>
		</div>
		);
}

export {Transaccion};
